import React from "react";
import "./OverviewSection.scss";
import { Order } from "../../../types/types";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import AssignmentIcon from "@mui/icons-material/Assignment";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import DoneIcon from "@mui/icons-material/Done";
import PendingIcon from "@mui/icons-material/Pending";

type Props = { orders: Order[] };

function OverviewSection({ orders }: Props) {
  const totalOrders = orders.length;
  const totalRevenue = orders.reduce(
    (acc, curr) => acc + curr.requiredQuantity,
    0
  );
  const openOrders = orders.filter(
    (order) => order.orderStatus === "OPEN"
  ).length;
  const finishedOrders = orders.filter(
    (order) => order.orderStatus === "DONE"
  ).length;

  return (
    <div>
      <h2 className='overview-section__title'>Overview</h2>
      <List>
        <ListItem>
          <ListItemIcon>
            <AssignmentIcon />
          </ListItemIcon>
          <ListItemText
            primary='Total Orders'
            secondary={`${totalOrders} pcs`}
          />
        </ListItem>
        <ListItem>
          <ListItemIcon>
            <ShoppingCartIcon />
          </ListItemIcon>
          <ListItemText
            primary='Ordered Quantity'
            secondary={`${totalRevenue} pcs`}
          />
        </ListItem>
        <ListItem>
          <ListItemIcon>
            <PendingIcon />
          </ListItemIcon>
          <ListItemText primary='Open Orders' secondary={`${openOrders} pcs`} />
        </ListItem>
        <ListItem>
          <ListItemIcon>
            <DoneIcon />
          </ListItemIcon>
          <ListItemText
            primary='Finished Orders'
            secondary={`${finishedOrders} pcs`}
          />
        </ListItem>
      </List>
    </div>
  );
}

export default OverviewSection;
